import hed from './style.module.css'

const Footer = () => {
  return (
    <>
      <header class="root">
        <div class="forest"></div>
        <div class="container">
            <h1>This is title</h1>
        <p>This is Description!</p>
        </div>
    </header>
    </>
    );
}

export default Footer;
